Gideon is a 7 year old cuddly boy in search of a good home. He is neutered and up to date on all vaccines, flea and heartworm preventative medication. He is great with children - lives with a 2 year old and a 3 year old and is incredibly patient with their attention. He loves attention and cuddles and regularly sits on people's laps if they are on the floor. He is housebroken. He is not currently crate trained but we are working on it.&nbsp;
&nbsp;
Gideon is a protector with high anxiety. He goes on high alert when out with his people on walks or car rides. He has been on anxiety medication for 3 years and has some destructive habits when separated from his people. A good home for Gideon would require someone with the patience and knowledge to help him through his anxiety.&nbsp;
&nbsp;
He needs a home with a yard, preferably fenced (high fence - he can jump!) so he can run and roam. He is prey driven and has caught rabbits, snakes and turtles (and tried to catch squirrels and birds). He does well with other dogs when properly introduced and attends doggy daycare occasionally. He was raised with another lab for the first few years of his life and LOVED her - I think he misses having a doggy friend but needs one that is not going to challenge his alpha spot or they may not get along. He has never been around a cat but I would worry about the prey drive in that situation.

