Hi! I&#39;m Lucas. &nbsp;When I first got here, I came down with parvo and was very, very sick for a while. &nbsp;It got even worse when I got a respiratory infection while I was trying to fight the parvo. Everyone was shocked when I finally got to go home after almost two weeks. &nbsp;But I made it! I&#39;m a fighter and just a wonderful dog with a big heart. &nbsp;And I&#39;m pretty darn good-looking, too!&nbsp;&nbsp;

I&#39;m surprised I haven&#39;t been adopted yet because I feel like I&#39;m a really great dog that will make a wonderful buddy for almost anyone!&nbsp; I love to run and play and have lots of great friends here, including my girlfriend Blossom. &nbsp;I&#39;m really well-behaved. &nbsp;I listen well and I&#39;m even allowed outside the fence to go swimming at our lake here.&nbsp;

I&#39;m really athletic and I can jump a 4&#39; fence so it&#39;s safest for me if you have a 6&#39; fence or don&#39;t leave me outside alone. &nbsp;I would love to be with an active person or family who can keep me busy retrieving, swimming, running or hiking. &nbsp;But I&#39;m also cuddly and affectionate, so I need that too.

Do you think you can give me the home I deserve? I have been at IWAG for 10+ years! I would love to spend the rest of my days exploring your yard and cuddling with you! If you are interested in me, fill out an application at IWAG.org!&nbsp;

